const StorageNavBar = ({ currentFolder }) => {
    return (
        <div className="flex">
            <AddFolderBtn currentFolder={currentFolder}/>
            <AddFileBtn currentFolder={currentFolder}/>
        </div>
    );
};

export default StorageNavBar;
